import styled from 'styled-components'
const Story = ({ story }) => {
  const Paragraph = styled.p`
    font-size: 20px;
    border: none;
    margin-left: 200px;
    display: flex;
    align-items: center;
    flex-direction: column;
  `
  return (
    <>
      {story.map((el) => (
        <div key={el.id}>
          <Paragraph>{el.title}</Paragraph>
        </div>
      ))}
    </>
  )
}

export default Story
